import React from "react";
import './login.css';
import CreateAccount from './createAccount';

export default function Login(props) {
    const [hideLogin, setHideLogin] = React.useState(false);
    const style = hideLogin ? { display: 'none' } : {};
    const [register, setRegister] = React.useState(false);
    const createNewAccount = register ? <CreateAccount /> : <div></div>;

    function handleChange(e) {
        setHideLogin(true);
        props.whenClose(true);
    }

    function createNew() {
        setRegister(true);
        setHideLogin(true);
    }

    return (
        <div>
            {createNewAccount}
            <div className="Login" style={style} >
                <div className="exit" onClick={handleChange} >X</div>
                <div className="qwe">
                    <div className="sign-in-title">Sign In</div>
                    <form>
                        <div className="text">
                            <label for="username">Username</label><br />
                            <input type="text" name="Uname" placeholder="Enter Username" className="login-text s-center" /><br />
                        </div>
                        <div className="text">
                            <label for="password">Password</label><br />
                            <input type="text" name="Pname" placeholder="Enter Password" className="login-text s-center" /><br />
                        </div>
                        <div className="createButton" onClick={createNew}>Don't have an account? Click here to create one</div>
                        <button type="submit" className="continue s-center"><span>Continue</span></button>
                    </form>
                </div>
            </div>
        </div>
    )

}
